function fireit() {
    var spin = Math.floor(Math.random() * 6);
    var base = document.getElementById("base");
  
    if (spin <= document.fire.bullets.value - 1) {
      setTimeout(() => {
        base.classList.remove("idle");
        base.classList.add("shoot");
      }, 100);
      setTimeout(() => {
        base.classList.remove("shoot");
        base.classList.add("idle");
      }, 900);
      setTimeout(() => {
        alert("당첨!");
      }, 1000);
    } else {
      setTimeout(() => {
        base.classList.remove("idle");
        base.classList.add("break");
      }, 1);
      setTimeout(() => {
        base.classList.remove("break");
        base.classList.add("idle");
      }, 1000);
      document.fire.message.value = "발사!";
      setTimeout("document.fire.message.value='Play Shooting'", 600);
    }
  }

  const share = document.getElementById('share');
const dice = document.getElementById('dice_button');
const roullet_content = document.getElementsByClassName('roulette_content')[0];
const ladder_content = document.getElementsByClassName('ladder_content')[0];
const dice_content = document.getElementsByClassName('dice_content')[0];

share.addEventListener('click', () => {
    const url = window.location.href;
    window.navigator.clipboard.writeText(url).then(() => {
        alert('복사 완료! 친구들에게 공유해주세요!');
    });
});

dice.addEventListener('click', () => {
    roullet_content.style.display = 'none';
    ladder_content.style.display = 'none';
    dice_content.style.cssText = 'display: flex';
});